import React, {Component} from 'react';
export default class TopRight extends Component {
    render(){
        return (
            <div className='padding-top-md padding-left-right-sm centering'>
                <div className='text t-18 '>
                    <div className='text'>Curriculum Vitae</div>
                    <div className='text'>E-mail</div>
                    <div className='text'>Twitter</div>
                </div>
            </div>
        )
    }
}
